    "demo.coffee.md": {
      "path": "demo.coffee.md",
      "content": "Hamlet Demo\n===========\n\nHamlet is a templating language for web applications. It's like React, Angular,\nor Knockout except even better!\n\nMultiple Bindings\n-----------------\n\n>     #! demo\n>     template = \"\"\"\n>       %input(type=\"text\" @value)\n>       %select(@value options=[1..@max])\n>       %hr\n>       %input(type=\"range\" @value min=\"1\" @max)\n>       %hr\n>       %progress(@value @max)\n>     \"\"\"\n>     model =\n>       max: 10\n>       value: Observable 5\n\n---\n\nInline Events\n-------------\n\n>     #! demo\n>     template = \"\"\"\n>       %button(click=@hello) Hello!\n>     \"\"\"\n>     model =\n>       hello: ->\n>         alert \"hello\"\n\n---\n\nDependent Functions\n-------------------\n\n>     #! demo\n>     template = \"\"\"\n>       %h2= @name\n>       %input(value=@first)\n>       %input(value=@last)\n>     \"\"\"\n>\n>     model =\n>       name: ->\n>         \"#{@first()} #{@last()}\"\n>       first: Observable(\"Mr.\")\n>       last: Observable(\"Doberman\")\n\n---\n\nCheckbox\n--------\n\n>     #! demo\n>     template = \"\"\"\n>       %label\n>         %input(type=\"checkbox\" @checked)\n>         = @checked\n>     \"\"\"\n>     model =\n>       checked: Observable true\n\n---\n\nDisabling Inputs\n----------------\n\n>     #! demo\n>     template = \"\"\"\n>       %button(click=@hello @disabled) A Button\n>       %button(click=@toggle) Toggle\n>     \"\"\"\n>     model =\n>       hello: ->\n>         alert \"hello\"\n>       disabled: Observable true\n>       toggle: ->\n>         @disabled.toggle()\n>\n\n---\n\nTODO List\n---------\n\n>     #! demo\n>     template = \"\"\"\n>       %h2 TODO List\n>       %ul(style=\"list-style-type: none; padding: 0;\")\n>         - each @items, (item) ->\n>           %li\n>             %label\n>               %input(type=\"checkbox\")\n>               = item\n>       %form(submit=@add)\n>         %input(value=@name)\n>         %button Add Item\n>     \"\"\"\n>     model =\n>       name: Observable \"\"\n>       items: Observable []\n>       add: ->\n>         @items.push @name()\n>         @name(\"\")\n>         return false\n\n\n---\n\nHTML Elements\n-------------\n\n>     #! demo\n>     template = \"\"\"\n>       %ul\n>         = @item(\"Hey\")\n>         = @item(\"There\")\n>         = @item(\"Dude\")\n>     \"\"\"\n>     model = \n>       item: (text) ->\n>         $(\"<li>\", text: text).get(0)\n\n---\n\nKnockout Demo\n-------------\n\n>     #! demo\n>     template = \"\"\"\n>       %select(value=@chosenTicket options=@tickets)\n>       %button(@disabled click=@reset) Clear\n>       .choice\n>         - each @chosenTicket, ->\n>           .ticket\n>             - if @price\n>               You have chosen!\n>               %b= @name\n>               = @price\n>     \"\"\"\n\n>     model =\n>       tickets: [\n>         {name: \"Choose...\", price: \"\"}\n>         {name: \"Economy\", price: 199.95}\n>         {name: \"Business\", price: 449.22}\n>         {name: \"First Class\", price: 1199.99}\n>       ]\n>       chosenTicket: Observable()\n>       reset: ->\n>         @chosenTicket(@tickets[0])\n>       disabled: ->\n>         @chosenTicket() is @tickets[0] or !@chosenTicket()?\n\n---\n\nInteractive Runtime\n-------------------\n\n>     #! setup\n>     require \"/interactive\"\n",
      "mode": "100644",
      "type": "blob"
    },
    "interactive.coffee.md": {
      "path": "interactive.coffee.md",
      "content": "Interactive Runtime for Docs\n============================\n\n    require \"./lib/hamlet\"\n\n    {CoffeeScript, Observable, Compiler} = Hamlet\n\n    # {applyStylesheet, CSON} = require \"./lib/util\"\n    # applyStylesheet require \"./style/demo\"\n\n    # TODO: Textarea for template, text area for data, live interactive demo\n    # Changing data reloads the new data into the same template\n    # Changing template reloads the same data into the new template\n\n    Interactive.register \"demo\", ({source, runtimeElement}) ->\n      code =\n        \"var template, model;\" +\n        CoffeeScript.compile(source, bare: true)\n\n      code += \"\\nreturn [template, model];\"\n\n      [template, model] = Function(\"Observable\", code)(Observable)\n\n      view = Function(\"return \" + Compiler.compile(template, runtime: \"Hamlet\"))()\n\n      runtimeElement.empty().append view(model)\n",
      "mode": "100644",
      "type": "blob"
    },
